import React from "react";
// import './Rank.css'

const Rank = (props) => {
    const {name, entries} = this.props;
    return (
        <div>
           <div className="f3 white">
               {"${name}, your current rank is...${entries}"}
           </div>
           <div className="f1 white">
               {"#1"}
           </div>
        </div>
    )
}

export default Rank;
